    "2015-05-14T04:23:24.448360",nt"name": "marylands-8-digit-sub-watersheds",nt"isopen":
    false,nt"url": null,nt"notes": "This is statewide digital watershed data.
    This file depicts the State with 138 separate watersheds each with an 8-digit numeric
    code. This file was created primarily for State and Federal agency use.  The creation
    of this file goes back many years and involved several State and Federal agencies.
    This file was derived from a more detailed watershed file (Maryland's Third-Order
    Watershed).  The U.S. Natural Resources Conservation Service (NRCS) redefined the
    third order watersheds creating the HUA14 file. The process used to create this
    file is consistent with the elevation contour information found on the US Geological
    Survey's 7.5 minute topographic quadrangle maps and the Maryland Department of the
    Environment's watershed location and naming conventions.  This file is similar,
    but not identical, to the US Natural Resources Conservation Service's (NRCS) Hydrologic
    Unit Code (HUC11) watershed file. The watersheds define Strahler (Strahler 1952
    p.1120) third order stream drainage by contours on U.S. Geological Survey (USGS)
    7.5 minute quadrangle map sheets.  Some watershed drainage areas were defined for
    streams less than third order and some large area Watersheds were split to maintain
    a maximum size of 15,000 acres. This watershed data is used by many state and local
    government agencies to accurately locate and report many landscape activities by
    watershed in Maryland.",nt"license_title": "License Not Specified",nt"extras":
